import React from 'react';
import './Logo.css';

const Logo = () => {
  return (
    <div className="logo-container">
      <div className="star">
        <div className="star-extension"></div>
      </div>
      <div className="logo-text">Repute</div>
    </div>
  );
};

export default Logo;
